        dsource_species_dtemperature_[1] += -drate_of_progress_0_dtemperature;
        dsource_species_dtemperature_[3] += -drate_of_progress_0_dtemperature;
        dsource_species_dtemperature_[2] += drate_of_progress_0_dtemperature;
